    memo = {0: 0, 1: 1}
    if n in memo:
        return memo[n]
    if n % 2 == 0:
        memo[n] = (2 * fibonacci(n // 2 - 1) + fibonacci(n // 2)) * fibonacci(n // 2) % MOD
    else:
        memo[n] = (fibonacci((n + 1) // 2) ** 2 + fibonacci((n + 1) // 2) ** 2) % MOD
    return memo[n]

